import { useParams,Link } from "react-router-dom";
import {Accordion , Image } from "react-bootstrap";
import axios from "axios";



const Borders = (props) =>{



    return ( 
        <>

        <Accordion.Item eventKey={props.id+2}>
        <Accordion.Header><Link to={`/country/${props.name}`}>{props.name}</Link></Accordion.Header>
        <Accordion.Body>
        <Image src={props.flag} variant='top'/>
        <p>{props.region}</p>
        </Accordion.Body>
      </Accordion.Item>
      </>
    )

}
export default Borders;
